syntax = "proto3";
option csharp_namespace = "Common.Protobuf";

option java_package = "catgirl.kirara.moe";

import "VintageCampChallengeLevelData.proto";

// Name: POOLBEFCIIE
message VintageCampChallengeStageData {
    uint32 open_time = 4;
    bool is_finish = 13;
    map<uint32, VintageCampChallengeLevelData> camp_level_map = 15;
    uint32 stage_id = 9;
    uint32 max_finished_level = 2;
    bool is_open = 6;
}

